import React from 'react';
import './contactPage.css';

const contactPage = () => {
  return (
    <div className='contact'>
      <div className='contact-top'></div>
      <div className='contact-middle'></div>
      <div className='contact-bottom'></div>
    </div>
  )
}

export default contactPage
